import React from "react";

export default function UserList() {
  return (
    <div className="flex content">
      <div className="flex-side bg-gray">
        <img style={{width:'30%'}} src={require("../assets/images/dice.png")} alt="" height="200" />
      </div>
      <div className="flex-main w-full">main</div>
    </div>
  );
}
